    public function getSourceContext(): Source
    {
        return new Source("<!DOCTYPE html>
<html lang=\"es-ES\">
    <head>
        <title>{% block title %}{% endblock %}</title>

        <meta charset=\"UTF-8\" />
        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />
        <meta name=\"author\" content=\"Eduardo Martínez Vázquez\" />

        <link rel=\"icon\" href=\"data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 128 128%22><text y=%221.2em%22 font-size=%2296%22>⚫️</text><text y=%221.3em%22 x=%220.2em%22 font-size=%2276%22 fill=%22%23fff%22>sf</text></svg>\">

        {% block styles %}
            <link rel=\"stylesheet\" href=\"/assets/styles/index.css\" />
        {% endblock %}

        {% block scripts %}
            <script type=\"importmap\">
                {
                    \"imports\": {
                        \"art\": \"/core/art.js\",
                        \"board\": \"/components/board.js\",
                        \"card-deck\": \"/components/card-deck.js\",
                        \"card\": \"/components/card.js\"
                    }
                }
            </script>
            <script type=\"module\" src=\"/index.js\"></script>
        {% endblock %}
    </head>

    <body>
        {% block body %}
            <header>
                {% block header %}
                    <nav>
                        <ul class=\"navigation__list\">
                            {% block navigationList %}
                                <li><a href=\"{{ path('card_list') }}\">Cartas</a></li>
                            {% endblock %}
                        </ul>
                    </nav>

                    <ul class=\"authentication__list\">
                        {% block authenticationList %}
                            {% if not app.user %}
                                <li><a href=\"{{ path('login') }}\">Iniciar sesión</a></li>
                                <li><a href=\"{{ path('sign_in') }}\">Registrarse</a></li>
                            {% else %}
                                <li><a href=\"#\">Perfil</a></li>
                                <li><a href=\"{{ path('logout') }}\">Cerrar sesión</a></li>
                            {% endif %}
                        {% endblock %}
                    </ul>
                {% endblock %}
            </header>

            <div class=\"layout-content\">
                <main>
                    {% block main %}{% endblock %}
                </main>

                <aside>
                    <ul class=\"aside__list\">
                        {% block aside %}
                            {% if is_granted('ROLE_ADMIN') %}
                                <li><a href=\"{{ path('administration') }}\">Panel de administración</a></li>
                            {% endif %}
                        {% endblock %}
                    </ul>
